import React, { useState } from 'react';

const Mockup = () => {
  const [selectedFloor, setSelectedFloor] = useState('/assets/marble-floor-2.jpg');

  const floorOptions = [
    {
      id: 'marble1',
      name: 'Marble Classic',
      image: '/assets/marble-floor-2.jpg'
    },
    {
      id: 'marble2', 
      name: 'Marble Modern',
      image: '/assets/marble-floor-2.png'
    },
    {
      id: 'marble3',
      name: 'Marble Luxury', 
      image: '/assets/marblefloor3.jpg'
    },
    {
      id: 'special',
      name: 'Special Pattern',
      image: '/assets/awfgazdgh.png'
    }
  ];

  const liftStyle = {
    width: '450px',
    height: '400px',
    margin: '20px auto',
    position: 'relative',
    transform: 'perspective(800px) rotateX(25deg) rotateY(-5deg)',
    transformStyle: 'preserve-3d'
  };

  const liftInteriorStyle = {
    width: '400px',
    height: '360px',
    margin: '20px',
    position: 'relative',
    background: 'rgba(240, 240, 240, 0.3)',
    borderRadius: '10px',
    boxShadow: '0 20px 40px rgba(0,0,0,0.2)',
    transformStyle: 'preserve-3d'
  };

  const backWallStyle = {
    position: 'absolute',
    top: '0',
    left: '0',
    right: '0',
    height: '250px',
    background: 'linear-gradient(180deg, rgba(245,245,245,0.4) 0%, rgba(232,232,232,0.4) 50%, rgba(221,221,221,0.4) 100%)',
    borderRadius: '10px 10px 0 0',
    transform: 'translateZ(-100px)'
  };

  const leftWallStyle = {
    position: 'absolute',
    top: '0',
    left: '0',
    width: '100px',
    height: '250px',
    background: 'linear-gradient(90deg, rgba(224,224,224,0.5), rgba(240,240,240,0.3))',
    borderRadius: '10px 0 0 0',
    transform: 'rotateY(90deg) translateZ(0px)',
    transformOrigin: 'left center'
  };

  const rightWallStyle = {
    position: 'absolute',
    top: '0',
    right: '0',
    width: '100px', 
    height: '250px',
    background: 'linear-gradient(-90deg, rgba(224,224,224,0.5), rgba(240,240,240,0.3))',
    borderRadius: '0 10px 0 0',
    transform: 'rotateY(-90deg) translateZ(0px)',
    transformOrigin: 'right center'
  };

  const floorStyle = {
    position: 'absolute',
    bottom: '0',
    left: '0',
    right: '0',
    height: '110px',
    backgroundImage: `url(${selectedFloor})`,
    backgroundSize: 'cover',
    backgroundPosition: 'center',
    backgroundRepeat: 'no-repeat',
    borderRadius: '0 0 10px 10px',
    boxShadow: 'inset 0 5px 15px rgba(0,0,0,0.4), 0 -5px 20px rgba(0,0,0,0.3)',
    transform: 'translateZ(5px)',
    border: '3px solid rgba(255,255,255,0.8)'
  };

  const ceilingStyle = {
    position: 'absolute',
    top: '10px',
    left: '10px',
    right: '10px',
    height: '30px',
    background: 'linear-gradient(145deg, rgba(248,248,248,0.4), rgba(224,224,224,0.4))',
    borderRadius: '8px',
    boxShadow: '2px 2px 8px rgba(0,0,0,0.1)',
    transform: 'translateZ(-50px)'
  };

  const lightStyle = {
    position: 'absolute',
    top: '50%',
    left: '50%',
    transform: 'translate(-50%, -50%)',
    width: '80px',
    height: '15px',
    background: 'linear-gradient(90deg, rgba(255,255,255,0.6), rgba(240,240,240,0.4))',
    borderRadius: '20px',
    boxShadow: '0 0 15px rgba(255,255,255,0.5), inset 2px 2px 4px rgba(0,0,0,0.1)'
  };

  const controlPanelStyle = {
    position: 'absolute',
    top: '60px',
    right: '15px',
    width: '35px',
    height: '120px',
    background: 'linear-gradient(145deg, rgba(44,44,44,0.7), rgba(26,26,26,0.7))',
    borderRadius: '8px',
    boxShadow: '3px 3px 8px rgba(0,0,0,0.3)',
    display: 'flex',
    flexDirection: 'column',
    justifyContent: 'space-around',
    alignItems: 'center',
    padding: '5px',
    transform: 'translateZ(10px)',
    backdropFilter: 'blur(2px)'
  };

  const buttonStyle = {
    width: '20px',
    height: '20px',
    borderRadius: '50%',
    background: 'radial-gradient(circle, #4a4a4a, #2a2a2a)',
    border: '2px solid #333',
    boxShadow: '1px 1px 3px rgba(0,0,0,0.5)',
    fontSize: '8px',
    color: '#888',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center'
  };

  const selectorStyle = {
    display: 'flex',
    justifyContent: 'center',
    gap: '15px',
    marginTop: '60px',
    flexWrap: 'wrap',
    perspective: '1000px'
  };

  const optionStyle = {
    padding: '10px 15px',
    borderRadius: '8px',
    border: '2px solid rgba(255,255,255,0.3)',
    background: 'rgba(255,255,255,0.9)',
    cursor: 'pointer',
    transition: 'all 0.3s ease',
    textAlign: 'center',
    minWidth: '120px',
    backdropFilter: 'blur(10px)',
    boxShadow: '0 4px 15px rgba(0,0,0,0.1)'
  };

  const selectedOptionStyle = {
    ...optionStyle,
    border: '2px solid #007bff',
    background: 'rgba(231, 243, 255, 0.95)',
    transform: 'scale(1.05) translateY(-5px)',
    boxShadow: '0 8px 25px rgba(0,123,255,0.3)'
  };

  const previewStyle = {
    width: '40px',
    height: '40px',
    borderRadius: '4px',
    backgroundSize: 'cover',
    backgroundPosition: 'center',
    margin: '0 auto 8px',
    border: '2px solid #eee'
  };

  return (
    <div style={{ 
      padding: '20px', 
      fontFamily: 'Arial, sans-serif',
      background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)',
      minHeight: '100vh',
      overflow: 'hidden'
    }}>
      <h2 style={{ 
        textAlign: 'center', 
        color: 'white',
        marginBottom: '20px',
        fontSize: '28px',
        textShadow: '2px 2px 4px rgba(0,0,0,0.3)'
      }}>
        Lift Floor Customizer
      </h2>

      {/* Lift Structure */}
      <div style={liftStyle}>
        <div style={liftInteriorStyle}>
          {/* Ceiling */}
          <div style={ceilingStyle}>
            <div style={lightStyle}></div>
          </div>

          {/* Walls */}
          <div style={backWallStyle}></div>
          <div style={leftWallStyle}></div>
          <div style={rightWallStyle}></div>

          {/* Control Panel */}
          <div style={controlPanelStyle}>
            <div style={buttonStyle}>2</div>
            <div style={buttonStyle}>1</div>
            <div style={buttonStyle}>G</div>
            <div style={buttonStyle}>B</div>
          </div>

          {/* Floor (Changeable) - Main Focus */}
          <div style={floorStyle}>
            <div style={{
              position: 'absolute',
              bottom: '5px',
              right: '5px',
              background: 'rgba(255,255,255,0.9)',
              padding: '5px 10px',
              borderRadius: '15px',
              fontSize: '10px',
              fontWeight: 'bold',
              color: '#333',
              boxShadow: '0 2px 5px rgba(0,0,0,0.3)'
            }}>
              FLOOR
            </div>
          </div>
        </div>
      </div>

      {/* Floor Selection */}
      <div style={selectorStyle}>
        {floorOptions.map((floor) => (
          <div
            key={floor.id}
            style={selectedFloor === floor.image ? selectedOptionStyle : optionStyle}
            onClick={() => setSelectedFloor(floor.image)}
          >
            <div 
              style={{
                ...previewStyle,
                backgroundImage: `url(${floor.image})`
              }}
            ></div>
            <div style={{ fontSize: '12px', fontWeight: 'bold' }}>
              {floor.name}
            </div>
          </div>
        ))}
      </div>

      <div style={{
        textAlign: 'center',
        marginTop: '20px',
        color: 'white',
        fontSize: '14px'
      }}>
        Click on a floor style to see it applied to the lift
      </div>
    </div>
  );
};

export default Mockup;
